import React from 'react';
import Navbar from '../components/Navbar'
import logo from '../images/badge-header.svg'
import './styles/badge_new.css'
import Badge from './'


class BadgeNew extends React.Component {
    render() {
        return (
            <div>
                <Navbar />
                <div className='BadgeNew__hero'>
                    <img className='img-fluid' src={logo} alt='hero_logo' />
                </div>
                <div className='container'>
                    <div className='row'>
                        <div className='col'>
                            <Badge firstName='Daniela' lastName='Morales' twitter='Daniela10716033' jobTitle=''/>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default BadgeNew;
